      "qtext": "<b>PASSAGE<b/> Unemployment is the problem of every modern nation. The government is not able to ensure a job for everyone. Following the conventional strategy of creating employment, governments of many developing countries try to attract employers (business houses/industrialists) by offering tax rebates and many other facilities so that they locate their upcoming plants on their soil, and thereby create industrial employment. But there is a limit to what industry can bring. Also, industrial plants often create toxic waste which results in air and water pollution and environmental problems which can outweigh whatever implement benefit industrial employment may bring as substantial relief to the dwindling economy of the host country and the profits of such foreign investments are carried back to the parent company and foreign shareholders aboard.<br/>Self-employment has none of these drawbacks. The problem is that self-employment is not as obviously glamorous is not as a shiny new factory. But profits from self-employment remain in the country where they are produced. It is too small to create environmental hazards. It also puts the poor person in charge of his or her own working hours and conditions. The hours are flexible and can be adapted to fit any family situation. It allows people to choose between running a business full time and part time when they face a crisis, or to put their business on hold and work full time for a salary. Self-employment is tailor-made for anyone who is street-smart and has many acquired and inherited traditional skills, rather than learning acquired from books and technical schools. This means the illiterate and the poor can exploit their strengths, rather than be held back by their weaknesses. It allows a person to turn their hobbies into gainful employment. It allows individuals who cannot work well in a rigid hierarchy to run their own show.<br/>Financing the poor to start their own little ventures elevates their sense of pride and self-respect. It offers a way out of welfare dependency, not just to become wage slaves, but to open a store or start a manufacturing business. It can help those who have found a job and are still nonetheless poor. It gives the victims of prejudice who would not be hired because of their colour or national origin a chance to earn a living. The average cost of creating self-employment is ten, twenty or hundred times lesser than creating industry-based employment. It helps isolated poor people gain self-confidence, step by step.<br/>Obviously, self-employment has limits, but in many cases, it is the only solution to help those whom economies refuse to hire and taxpayers do not want to carry on their shoulders. The policy needed for the eradication of poverty must be much wider and deeper than the policy for the provision of mere employment. Real eradication of poverty begins when people are able to control their own fate. Poor people are like bonsai trees. When you plant the best seed of the tallest tree in a flower pot, you get a replica of the tallest tree, only inches tall. There is nothing wrong with the seed you planted; only the soil base that is too inadequate. Poor people are bonsai people. There is nothing wrong with their seeds. Simply society never gave them the base to grow. All it takes to get the poor people out of poverty is for us to create an enabling environment for them. Once the poor are able to unleash their energy and creativity, poverty will disappear very quickly. <br/> Choose the word/group of words which is MOST OPPOSITE in MEANING to The word/group of words printed in bold us used in the passage.<br/> RIGID",
